  `id_review` int NOT NULL AUTO_INCREMENT,
  `id_user` int NOT NULL,
  `id_store` int NOT NULL,
  `score` float DEFAULT NULL,
  `content` varchar(1000) DEFAULT NULL,
  `upload_date` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_date` datetime DEFAULT NULL,
  `likeCnt` int DEFAULT '0',
  `active` tinyint DEFAULT '1',
  PRIMARY KEY (`id_review`),
  KEY `fk_review_store_idx` (`id_store`),
  KEY `fk_review_user_idx` (`id_user`),
  CONSTRAINT `fk_review__store` FOREIGN KEY (`id_store`) REFERENCES `store` (`id_store`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_review__user` FOREIGN KEY (`id_user`) REFERENCES `user` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='유저가 식당에 남긴 리뷰 정보를 가지는 테이블';
